import React from 'react';

import Header from '../components/Header';
import MainDrinks from '../components/MainDrinks';
import MainMeals from '../components/MainMeals';

function Food() {
  const bools = false;
  const recipes = bools ? <MainDrinks /> : <MainMeals />;
  return (
    <div>
      <Header title="Comidas" isSearchable />
      {recipes}
    </div>
  );
}
export default Food;
